var title_f31_59_32692="DiGeorge pt infant adolesc";
var content_f31_59_32692=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F68022&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F68022&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 476px\">",
"   <div class=\"ttl\">",
"    Infant and adolescent with DiGeorge syndrome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 456px; height: 540px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A) Infant with DiGeorge syndrome has the typical hypertelorism, antimongoloid slant of the eyes, ear malformation, and peculiar mouth. B) Older child with DiGeorge syndrome depicts characteristic facial features, which become more subtle with age. Relatively consistent features are hooded eyelids, a bulbous nose tip, a broad nasal bridge, posteriorly rotated ears, simple ear helices, and micrognathia. This child has posteriorly rotated ears with simple helices, slightly hooded eyelids, and a slightly bulbous nose tip.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Ochs, HD, Nelson, DL, Stiehm, ER. Other Well-Defined Immunodeficiency Syndromes. In: Immunologic Disorders in Infants &amp; Children, Fifth Edition, Stiehm, ER, Ochs, HD, Winkelstein, JA (Eds), Elsevier, Philadelphia 2004. p.525. Copyright &copy;2004 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
