var title_f31_59_32697="Lentigo maligna dermoscopy";
var content_f31_59_32697=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F68828%7EDERM%2F63812&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F68828%7EDERM%2F63812&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Dermoscopic features of lentigo maligna",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 379px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Atypical pseudonetwork, annular-granular pattern and slate-gray areas are characteristics of lentigo maligna.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Dermoscopy of lentigo maligna melanoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 370px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A 69-year-old woman was evaluated for an enlarging pigmented lesion of her right cheek.&nbsp;Two biopsies were performed with the help of dermoscopy to outline the borders of the lesion. Pathology revealed a lentigo maligna melanoma. On this dermoscopic image (x50), one can see slate-gray dots and globules leading to annular-granular pattern which is typical of lentigo maligna melanoma.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Eric Ehrsam, MD, Dermatlas;",
"     <a href=\"file://www.dermatlas.org\" target=\"_blank\">",
"      file://www.dermatlas.org",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
