var title_f31_59_32698="Pathology electroanatomic map";
var content_f31_59_32698=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F81609%7ECARD%2F57238%7ECARD%2F81092&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F81609%7ECARD%2F57238%7ECARD%2F81092&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Correlation between electroanatomic map and pathological sections of infarcted heart",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 261px; height: 486px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Panel A shows a section of the left ventricle in a patient with a subendocardial myocardial infarction (arrow). The superimposed colors in the reconstruction from an electroanatomic map (panel B) depict bipolar electrogram amplitude (BEA); purple indicates values &gt;6.1 mV; red indicates values &lt;2.1 mV. Beneath the reconstructed sections (panel C) are typical recordings of unipolar electrogram and derivatives, the unipolar electrogram amplitude (UEA) and slew rate (SR) and bipolar electrogram and amplitude from selected points at the core of the infarcted region (the distance between two white marks on the electrogram time scale denotes a 50-ms period).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from the American College of Cardiology (Journal of the American College of Cardiology, 2001, 37:1590-7).",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.elsevier.com/locate/jacc\">",
"      file://www.elsevier.com/locate/jacc",
"     </a>",
"     <br/>",
"     <a href=\" file://www.sciencedirect.com\">",
"      file://www.sciencedirect.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Typical electroanatomic map of infarcted myocardium",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 318px; height: 307px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The electronatomic map of a patient with a myocardial infarction shows large regions of abnormal electromechanical activity and reduced local shortening (red, abnormally contracting regions with values &lt;4 percent). In contrast, a region in which function remains unhindered is a color-coded blue/purple, normal contractile function &gt;12 percent).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from the American College of Cardiology (Journal of the American College of Cardiology, 2001, 37:1590-7).",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.elsevier.com/locate/jacc\">",
"      file://www.elsevier.com/locate/jacc",
"     </a>",
"     <br/>",
"     <a href=\" file://www.sciencedirect.com\">",
"      file://www.sciencedirect.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Endocardial electroanatomic map of myocardial ischemia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 283px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are the right anterior oblique (A) and left anterior oblique (B) left ventricular (LV) local shortening (LS) map. Red represents regions with reduced LS (&lt;6 percent); yellow and green represents regions with mildly reduced LS (6 to 10 percent); blue and purple represent regions with LS &gt;10 percent. Panel C is the regional view of the same ventricle, presenting average LS values in 12 segments. Panel D is the right anterior oblique and panel E the left anterior oblique views of a unipolar voltage (UpV) of the same ventricle. Colors represent peak-to-peak amplitude of intracardiac electrogram, ranging from &le;5 mV (red) to &ge;16 mV (purple). Panel F is the regional view representing average regional UpV values of the same 12 segments. Ischemia produces a reduction in LS and decreased UpV.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: Fuchs S, Hendel RC, Baim DS, et al. Am J Cardiol 2001; 87:874 with permission from Excerpta Medica Inc.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.elsevier.com/locate/jacc\">",
"      file://www.elsevier.com/locate/jacc",
"     </a>",
"     <br/>",
"     <a href=\" file://www.sciencedirect.com\">",
"      file://www.sciencedirect.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
