var title_f31_59_32699="Mercury poisoning versus autism";
var content_f31_59_32699=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F68160&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F68160&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Characteristic findings in patients with mercury poisoning versus autism",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Finding",
"      </td>",
"      <td class=\"subtitle1\">",
"       Mercury poisoning",
"      </td>",
"      <td class=\"subtitle1\">",
"       Autism",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Motor",
"      </td>",
"      <td>",
"       Ataxia",
"      </td>",
"      <td>",
"       Repetitive behaviors",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Vision",
"      </td>",
"      <td>",
"       Bilateral visual field constriction",
"      </td>",
"      <td>",
"       None",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Speech",
"      </td>",
"      <td>",
"       Dysarthria",
"      </td>",
"      <td>",
"       Delayed speech, echolalia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"2\">",
"       Sensory",
"      </td>",
"      <td colspan=\"1\" rowspan=\"2\">",
"       Peripheral neuropathy, paresthesias",
"      </td>",
"      <td>",
"       Decreased responsiveness to pain",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Hyperacusis, hypersensitivity to other sensory stimuli",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Psychiatric",
"      </td>",
"      <td>",
"       Toxic psychosis; in mild cases, nonspecific depression, anxiety, irritability",
"      </td>",
"      <td>",
"       Socially aloof, insistence on sameness",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Head size",
"      </td>",
"      <td>",
"       Small",
"      </td>",
"      <td>",
"       Large",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Other",
"      </td>",
"      <td>",
"       In chronic mercury toxicity: hypertension, skin eruption, thrombocytopenia",
"      </td>",
"      <td>",
"       Seldom seen",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Nelson, KB, Bauman, ML. Thimerosal and autism? Pediatrics 2003; 111:674.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
