var title_f31_59_32700="Per act risk of HIV";
var content_f31_59_32700=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F60145&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F60145&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Estimated per-act risk for acquisition of HIV, by exposure route*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Exposure route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Risk per 10,000 exposures to",
"an infected source",
"       </td>",
"       <td class=\"subtitle1\">",
"        Reference",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Blood transfusion",
"       </td>",
"       <td>",
"        9,000",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Needle-sharing injection-drug use",
"       </td>",
"       <td>",
"        67",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Receptive anal intercourse",
"       </td>",
"       <td>",
"        50",
"       </td>",
"       <td>",
"        3, 4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Percutaneous needle stick",
"       </td>",
"       <td>",
"        30",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Receptive penile-vaginal intercourse",
"       </td>",
"       <td>",
"        10",
"       </td>",
"       <td>",
"        3, 4, 6",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Insertive anal intercourse",
"       </td>",
"       <td>",
"        6.5",
"       </td>",
"       <td>",
"        3, 4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Insertive penile-vaginal intercourse",
"       </td>",
"       <td>",
"        5",
"       </td>",
"       <td>",
"        3, 4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Receptive oral intercourse",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        4&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Insertive oral intercourse",
"       </td>",
"       <td>",
"        0.5",
"       </td>",
"       <td>",
"        4&bull;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Estimates of risk for transmission from sexual exposures assume no condom use.",
"     <br>",
"      &bull; Source refers to oral intercourse performed on a man.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     CDC. Antiretroviral postexposure prophylaxis after sexual, injection-drug use, or other nonoccupational exposure to HIV in the United States. MMWR 2005; 54(RR-02):1.",
"     <br>",
"      1. Donegan E, Stuart M, Niland JC, et al. Infection with human immunodeficiency virus type 1 (HIV-1) among recipients of antibody-positive blood donations. Ann Intern Med 1990;113:733-9.",
"      <br>",
"       2. Kaplan EH, Heimer R. HIV incidence among New Haven needle exchange participants: updated estimates from syringe tracking and testing data. J Acquir Immune Defic Syndr 1995;10:175-6.",
"       <br>",
"        3. European Study Group on Heterosexual Transmission of HIV. Comparison of female to male and male to female transmission of HIV in 563 stable couples. BMJ 1992;304:809-13.",
"        <br>",
"         4. Varghese B, Maher JE, Peterman TA, Branson BM, Steketee RW. Reducing the risk of sexual HIV transmission: quantifying the per-act risk for HIV on the basis of choice of partner, sex act, and condom use. Sex Transm Dis 2002;29:38-43.",
"         <br>",
"          5. Bell DM. Occupational risk of human immunodeficiency virus infection in healthcare workers: an overview. Am J Med 1997;102:9-15.",
"          <br>",
"           6. Leynaert B, Downs AM, De Vincenzi I; European Study Group on Heterosexual Transmission of HIV. Heterosexual transmission of HIV: variability of infectivity throughout the course of infection. Am J Epidemiol 1998;148:88-96.",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
