var title_f31_59_32701="Heart rate variability HF";
var content_f31_59_32701=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F62928&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F62928&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 478px\">",
"   <div class=\"ttl\">",
"    Absence of heart rate variability predicts mortality in HF",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 458px; height: 296px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Among patients with heart failure (HF), the absence of heart rate variability, defined as a standard deviation of RR intervals (SDNN) less than 50 msec was associated with a 51.4 percent annual mortality compared to 5.5 percent in those who had an SDNN greater than 100 msec and 12.7 percent in those who had an SDNN of 50 to 100 msec (p&lt;0.0001).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Nolan J, Batin PD, Andrews R, et al. Circulation 1998; 98:1510.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
